//import { createApp } from 'vue'
import Vue from 'vue';
import VueRouter from 'vue-router';
import App from './App.vue'
import GamePage from './pages/start_game.vue';

Vue.use(VueRouter);

const routes = [
  { path: '/', component: App },
  { path: '/game', component: GamePage }
];

const router = new VueRouter({
  routes
});

new Vue({
  router,
  render: h => h(App)
}).$mount('#app');



createApp(App).mount('#app')
